import React, { useEffect, useState } from "react";

const GameList = ({ games }) => {
  console.log(games)
  return (
    <div className="GameList">
      {games.map(game => (
        <div className="gamecard" key={game.id}>
          <div className="imgGame">
          <img src={game.background_image} alt="img" />
              <div className="name" >
                <h1>{game.name}</h1>
              </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default GameList;
